const paragraph = `Sou um desenvolvedor de software com 4 anos de experiência, focado no
desenvolvimento front-end. Trabalho atualmente com JavaScript, Vue.js
(incluindo testes unitários), PHP, Laravel (utilizando Docker) e bancos
de dados SQL. Possuo graduação em Análise e Desenvolvimento de Sistemas
e uma pós-graduação em Gestão de Produtos. Além disso, estou
familiarizado com a metodologia ágil, incluindo o Scrum, e tenho
experiência na estratégia de lançamento e desenvolvimento de produtos.`;

const texts = {
  paragraph,
};

export default texts;
